def sieve_of_eratosthenes(n, m=2):
    """"""
    prime = [True] * (n + 1)
    prime[0] = prime[1] = False
    for p in range(2, int(n ** 0.5) + 1):
        if prime[p]:
            for i in range(p * p, n + 1, p):
                prime[i] = False
    return [p for p in range(max(m, 2), n + 1) if prime[p]]
